(1, 'MD. Arif', 'MD. Saidul Rahman', 'Most. Arjina begum', '01773940587', 'arif.euitsols@gmail.com', '01774255936', NULL, '<p>23/7 haque Vila, Shenpara parbata Mirpur -10</p>', '<p>Chirirbandar, Dinajpur</p>', 'uploads/images/1582197243_76OESelT_400x400.jpg', '<p>To gain confidence and fame using my potential in the field of Web Design &amp; Development and express my innovative creative skills for self and company growth.</p>', 1, '2020-02-20 10:13:31', '2020-02-20 11:14:03'),
(2, 'MD Arif Hossain', 'MD Tabarak Ali', 'Most Alima Begum', '01738194729', 'arif.skill@gmail.com', '01937970812', NULL, '<p>301/2, Senpara Parbata, Mirpur 10, Dhaka 1216</p>', '<p>Vill: Kamdebpur, P/O: Keranirhat, Ward: 11, Rangpur City Corporation, Rangpur</p>', 'uploads/images/1582194765_78312998_2488391291197400_4906732941469548544_o.jpg', '<p>With experience of half a decade of working as a Graphic and UI/UX Designer I want to work in a professional environment where creativity matters the most. In the process, I want to keep on helping learners who want to build their potential in the field of Graphic Design.</p>', 1, '2020-02-20 10:32:45', '2020-02-20 10:37:26'),
(3, 'Md. Mahafujur Rahman', 'Md. Jamser Ali', 'Monjuma Begum', '01737831156', 'mahfujrahman462@gmail.com', '01737894466', NULL, '<p>H#118, Road#6, Mohammadi Housing Society. Mohammadpur.</p>', '<p>Moujashakhati, Chamtahat, Kaliganj, Lalmonirhat&nbsp;</p>', 'uploads/images/1582361019_mahfuj.jpg', '<p>Between 2014 to 2018, I have been working as a web &amp; software developer at IT firms. Although I am working as a backend developer I also have good experience of frontend development using Bootstrap,JavaScript, jQuery HTML5, CSS3 feature. Customize &amp; development wordpress, theme &amp; plugins and some others tools. I have developed and maintained complex Web and RESTful applications using PHP frameworks (Laravel, Codeigniter) and row PHP.</p>\r\n\r\n<p>I always love working with a technically strong team where I can solve complex problems with a good balance of freedom and responsibility. Able to work under pressure &amp; complete before deadline.</p>', 1, '2020-02-22 08:43:39', '2020-02-22 08:50:43'),
(4, 'Al-Amin', 'MD. Fazlul Haque', 'Most. Ambiya Begum', '01889977951', 'alamin.euitsols@gmail.com', '01780742255', NULL, '<p>Mirpur 10</p>', '<p>Debiganj, Panchagarh</p>', 'uploads/images/1582532420_Untitled-2.jpg', NULL, 1, '2020-02-24 08:20:20', '2020-02-24 08:20:20'),
(5, 'Md. Al-Amin', 'Azizul Haque', 'Anowara Begum', '01738001777', 'alamin.fits@gmail.com', '01770501227', '19957711414000070', '<p>Basila, Mohammadpur, Dhaka-1207</p>', '<p>Vill: Sordarpara, Thana: Atwary, Zilla: Panchagarh, Rangpur</p>', 'uploads/images/1583558936_alamin_vai.png', '<p>Innovative IT professional. Looking for more challenging job in a dynamic and esteemed organization where I will be able to work in any kind of situation and good working environment with full effort to utilize my knowledge, skills and experience for professional&rsquo;s career development and have positive chance to implement creativity.</p>', 1, '2020-03-07 05:02:35', '2020-03-07 05:28:57'),
(6, 'MD. Faruk Ahamed', 'MD. Mizanur Rahman', 'Mst. Ferdoushi Begum', '01796173484', 'faruk.euitsols@gmail.com', '01726401577', '19974915228000219', '<p>23/7 Haque Vila, Shenpara Parbata, Mirpur 10</p>', '<p>Kurigram Sadar</p>', 'uploads/images/1583560044_faruk.jpg', '<p>Innovative IT professional. Looking for more challenging job in a dynamic and esteemed organization where I<br />\r\nwill be able to work in any kind of situation and good working environment with full effort to utilize my<br />\r\nknowledge, skills and experience for professional&rsquo;s career development and have positive chance to implement<br />\r\ncreativity.</p>', 1, '2020-03-07 05:47:24', '2020-03-07 05:48:13'),
(7, 'MD. Al Mamun', 'MD. Ataur Rahman', 'Mst. Mahamuda Begum', '01723682468', 'msarkar.cse@gmail.com', NULL, NULL, '<p>H#812, Evenu 8, Road 11, Mirpur DSS, Dhaka</p>', '<p>Pirgonj, Rangpur</p>', 'uploads/images/1583560881_mamun.jpg', '<p>Hi, I am Al-Mamun Sakar. I have been working as a Software Engineer for 5 years. Mainly I develop web application using PHP language, Laravel and Codeingiter Framework. Beside this I also use Python programming language, Flask and Django framework for development. Programming is not just my profession it&#39;s my love. I love to practice Artificial Intelligence specially Machine learning and Deep learning. Because I want to be a Machine Learning Engineer in future. Please, Keep me in your prayers.</p>', 1, '2020-03-07 06:01:21', '2020-03-07 06:01:37'),
(8, 'Abdullah Al Reza', 'MD. Rezaul Islam', 'MSt. Ronju Are Islam', '01917897919', 'reza.ict@gmail.com', '01721563039', NULL, '<p>Sochid Bari, Uttor Badda, Gulshan</p>', '<p>Arpara, Shalikha,Magura</p>', 'uploads/images/1583562685_reja-vai222.png', '<p>Lead the IT department of the country and work closely with FHF global IT team to provide solution in a participatory approach.<br />\r\nManage end user accounts, permissions, access rights, and storage allocations in accordance with best practices in windows server 2012 r<br />\r\nManage &amp; Monitoring IT service (Auto failover, Bandwidth control, Port forwarding, MAC binding) through Mikrotik Router and Linux Server.</p>', 1, '2020-03-07 06:22:52', '2020-03-07 06:32:18'),
(9, 'ZUMANUR RAHMAN', 'M. M. Zafar Uddin', 'Mrs. Noor Jahan Begam', '01711124911', 'zumanur@gmail.com', NULL, '7334083396', '<p>Flat 5A, House 74/5, Road 4/2, Block B, Section 12, Mirpur, Dhaka 1216</p>', '<p>Permanent Address: House 450/1, Road- Station Road, Jamalpur 2000</p>', 'uploads/images/1583564254_zumanur vai.jpg', '<p>Generally I do Stationery, Branding related designs, Publications, UI/UX designs for the client of Upwork. In the past I attended in some contests of 99designs and freelancer.com and awarded as a winner several times. I am an exclusive author of Graphicriver and shop owner at Creative Market</p>', 1, '2020-03-07 06:57:34', '2020-03-07 06:57:59'),
(10, 'K. M. Saddam Hossain', 'Abdul Hamid Khan', 'Mst. Parvin Khatun', '01718170799', 'saddam1700@gmail.com', NULL, NULL, '<p>Dhaka</p>', '<p>B,Baria(Purbopara),&nbsp; Kalidashganti,&nbsp; Raigonj,&nbsp; Sirajgonj</p>', 'uploads/images/1583583618_Screenshot_1.png', '<p>Seeking challenging career in Information Technology sector to get a position of responsibility, using my skills efficiency to communicate my ideas and views and commit myself for achieving organization objectives with the team effort and my positive attitude and performance. I can use my capabilities through sincerely dedication and hard work to move up the graph of the Organization.</p>', 1, '2020-03-07 12:20:18', '2020-03-07 12:20:37');
